    false,nt"url": null,nt"notes": "This map is an experimental view of the
    Obama Administrationu2019s work in local communities. It is made up of data sets
    from initiatives across more than 15 Federal agencies. We are adding datasets and
    features to the map as we build it, so check back for updates. The map was built
    using open source tools and data, and we welcome your feedback at https://github.com/WhiteHouse/omb_place.rnrnrnMost
    of the data on the map is from Federal place-based initiatives around the country.
    Weu2019ve also added summary layers, which allow you to hover over a state or county
    to see how many initiatives are in that location. This map also includes background
    statistical and demographic information, such as US Census data on counties of persistent
    poverty, and data from a recent Harvard University study about upward economic mobility
